import React, { useState, useContext } from "react";
import styles from "./NavBar.module.css";
import { makeStyles } from "@material-ui/core/styles";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import Button from "@material-ui/core/Button";
import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";
import logo from "../logo.png";
import { createMuiTheme } from "@material-ui/core/styles";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import UserContext from "../userContext";

const useStyles = makeStyles((theme) => ({
  main: {
    backgroundColor: "transparent",
    color: "black",
  },
  title: {
    flexGrow: 1,
    marginLeft: -250,
  },
}));

const theme = createMuiTheme({
  overrides: {
    // Style sheet name ⚛️
    MuiButton: {
      // Name of the rule
      text: {
        // Some CSS
        color: "white",
      },
    },
  },
});

export default function NavBar() {
  const userContext = useContext(UserContext);
  const classes = useStyles();

  const logOutButton = () => {
    localStorage.setItem("token", '');
    localStorage.setItem("email", '');
    userContext.setUser({ email: '', token: ''});
  };

  return (
    <div className={classes.root}>
      <AppBar position="fixed" className={classes.main}>
        <Toolbar>
          <img className={styles.logo} src={logo} alt="Logo" />
          <Button classes={{ root: styles.buttonIn }} color="primary">
            FAVORITE RESTAURANTS
          </Button>
          <Button classes={{ root: styles.buttonIn }} color="primary" href="/profile">
            My profile
          </Button>
          <Button
            classes={{ root: styles.buttonIn }}
            color="secondary"
            onClick={logOutButton}
          >
            Sign out
          </Button>
        </Toolbar>
      </AppBar>
    </div>
  );
}
